i am using discord chat exporter for project that makes it possible to see some stats like the total amount called with a friend but for some reason I can not get CliWrap to work with it if someone has the time to look over this can you tell me whats wrong thank you

```C#
    String token = "nopeekinglmao";
    String channel = "somechannelid";
    String arguments = $"dotnet DiscordChatExporter.Cli.dll export -t {token} -c {channel} -o \"%C.json\"";
    String workingDirectory = Directory.GetCurrentDirectory();
    Console.WriteLine(workingDirectory);

    var stdOutBuffer = new StringBuilder();
    var stdErrBuffer = new StringBuilder();

    var result = await Cli.Wrap("cmd")
        .WithArguments(arguments)
        .WithWorkingDirectory(workingDirectory)
        .WithValidation(CommandResultValidation.None)
        .WithStandardOutputPipe(PipeTarget.ToStringBuilder(stdOutBuffer))
        .WithStandardErrorPipe(PipeTarget.ToStringBuilder(stdErrBuffer))
        .ExecuteBufferedAsync();

    // Contains stdOut/stdErr buffered in-memory as string
    var stdOut = stdOutBuffer.ToString();
    var stdErr = stdErrBuffer.ToString();

    Console.WriteLine(stdOut);
    Console.WriteLine(stdErr);```

I've also tried using CliWrap directly on the DiscordChatExporter.Cli.dll but that always gave me a non zero error code and this message ```Unhandled Exception: System.IO.FileNotFoundException: Could not load file or assembly 'System.Runtime, Version=4.2.2.0, Culture=neutral, PublicKeyToken=b03f5f7f11d50a3a' or one of its dependencies. The system cannot find the file specified.```
